import numpy as np
import math
import matplotlib.pyplot as plt

m=10**(-6)
def vk(v, va):
    a=1+(va)**2+2*v*va
    b=2*v*v*va-2*va
    c=-(v**2+(v*va)**2+2*v*va)
    return ((-b+math.sqrt(b**2-4*a*c))/(2*a))

def delva(v, va, mafk):
    u=vk(v, va)
    d=(u/(math.sqrt(1-u**2))+v/(math.sqrt(1-v**2)))
#     return -m*d*((1-va**2)**(3.0/2.0))/mafk 
    return -m*d/mafk 

